import { Component } from "react";
export default class Cards extends Component {
  render() {
    return (
      <div className="col-md-1">
        <ul>
          <li>{this.props.name}</li>
          <li>{this.props.time}</li>
          <li>{this.props.zoom}</li>
          <li>{this.props.purpose}</li>
        </ul>
      </div>
    );
  }
}
